import React from 'react';
import { Divider, Drawer, ListItem, ListItemIcon, ListItemText, Toolbar } from '@material-ui/core';
import MenuIcon from '@material-ui/icons/Menu';
import InboxIcon from '@material-ui/icons/MoveToInbox';
import MailIcon from '@material-ui/icons/Mail';
import AccessibleIcon from '@material-ui/icons/Accessible';
import ChildCareIcon from '@material-ui/icons/ChildCare';
import "./navdrawer.css";


class Navdrawer extends React.Component {
    constructor(props: any) {
        super(props);
    }
    render() {
        return (
            <div className="NavigationDrawer">
                <Drawer
                    classes={{
                        paperAnchorDockedLeft: "NavigationDrawerPaperAnchorDockedLeft",
                        root: "NavigationDrawerRoot",
                    }}

                    variant="permanent"
                    ModalProps={{
                        keepMounted: true,
                      }}>
                        
                    <Toolbar/>
                    <Divider />
                    <label className="sub">Nieuws Kanalen</label>
                    
                    <ListItem button >
                        <ListItemIcon>
                            <AccessibleIcon />
                        </ListItemIcon>
                        <ListItemText primary="Belangrijk nieuws"/>
                    </ListItem>
                    
                    <Divider />
                    <label className="sub">Chat Kanalen</label>
                    {['Publiek', 'Team Genoten', 'one more channel cuz why not'].map((text, index) => (
                        <ListItem button key={text}>
                            <ListItemIcon>
                                {index % 2 === 0 ? <InboxIcon /> : <MailIcon />}
                            </ListItemIcon>
                            <ListItemText primary={text} />
                        </ListItem>
                    ))}
                    <ListItem button >
                        <ListItemIcon>
                            <ChildCareIcon />
                        </ListItemIcon>
                        <ListItemText primary="Belangrijk nieuws"/>
                    </ListItem>
                </Drawer>
            </div>
        );
    }
}

export default Navdrawer;
